const config = {
  semi: false,
  singleQuote: true,
  trailingComma: "all",
};

export default config;

import {
  AlertTriangle,
  Bell,
  Clock,
  Mail,
  MailOpen,
  Shield,
  Users,
  X
} from 'lucide-react'
import { formatDistanceToNow } from 'date-fns'
import type { Notification } from '@/../product/sections/notifications-and-alerts/types'

interface NotificationCardProps {
  notification: Notification
  onMarkAsRead?: () => void
  onMarkAsUnread?: () => void
  onDismiss?: () => void
}

export function NotificationCard({
  notification,
  onMarkAsRead,
  onMarkAsUnread,
  onDismiss,
}: NotificationCardProps) {
  const getTypeIcon = (type: string) => {
    const icons = {
      'expiration-alert': AlertTriangle,
      'renewal-reminder': Bell,
      'team-member-alert': Users,
      'compliance-warning': Shield,
    }
    const Icon = icons[type as keyof typeof icons] || Bell
    return Icon
  }

  const getTypeColor = (type: string) => {
    const colors = {
      'expiration-alert': 'bg-amber-100 dark:bg-amber-900/30 text-amber-700 dark:text-amber-300',
      'renewal-reminder': 'bg-blue-100 dark:bg-blue-900/30 text-blue-700 dark:text-blue-300',
      'team-member-alert': 'bg-emerald-100 dark:bg-emerald-900/30 text-emerald-700 dark:text-emerald-300',
      'compliance-warning': 'bg-rose-100 dark:bg-rose-900/30 text-rose-700 dark:text-rose-300',
    }
    return colors[type as keyof typeof colors] || colors['renewal-reminder']
  }

  const getSeverityBadge = (severity: string) => {
    const badges = {
      critical: 'bg-rose-100 dark:bg-rose-900/30 text-rose-700 dark:text-rose-300 border-rose-200 dark:border-rose-800',
      warning: 'bg-amber-100 dark:bg-amber-900/30 text-amber-700 dark:text-amber-300 border-amber-200 dark:border-amber-800',
      info: 'bg-blue-100 dark:bg-blue-900/30 text-blue-700 dark:text-blue-300 border-blue-200 dark:border-blue-800',
    }
    return badges[severity as keyof typeof badges] || badges.info
  }

  const Icon = getTypeIcon(notification.type)
  const typeColor = getTypeColor(notification.type)

  return (
    <div
      className={`relative bg-white dark:bg-slate-900 border rounded-xl overflow-hidden transition-all hover:shadow-lg ${
        notification.isRead
          ? 'border-slate-200 dark:border-slate-800'
          : 'border-blue-300 dark:border-blue-700 shadow-md shadow-blue-500/10'
      }`}
    >
      {/* Unread Indicator */}
      {!notification.isRead && (
        <div className="absolute top-0 left-0 w-1 h-full bg-blue-500" />
      )}

      <div className="p-5 pl-6">
        <div className="flex items-start gap-4">
          {/* Icon */}
          <div className={`flex-shrink-0 p-2.5 rounded-lg ${typeColor}`}>
            <Icon className="w-5 h-5" />
          </div>

          {/* Content */}
          <div className="flex-1 min-w-0">
            {/* Header */}
            <div className="flex items-start justify-between gap-3 mb-2">
              <div className="flex-1">
                <h3 className={`font-semibold mb-1 ${
                  notification.isRead
                    ? 'text-slate-700 dark:text-slate-300'
                    : 'text-slate-900 dark:text-slate-100'
                }`}>
                  {notification.title}
                </h3>
                <div className="flex items-center gap-2 flex-wrap">
                  <span className={`px-2 py-0.5 text-xs font-medium rounded border ${getSeverityBadge(notification.severity)}`}>
                    {notification.severity}
                  </span>
                  {notification.daysUntilExpiration !== undefined && (
                    <span className="flex items-center gap-1 text-xs text-slate-500 dark:text-slate-400">
                      <Clock className="w-3 h-3" />
                      {notification.daysUntilExpiration} days
                    </span>
                  )}
                </div>
              </div>

              {/* Actions */}
              <div className="flex items-center gap-1">
                {notification.isRead ? (
                  <button
                    onClick={onMarkAsUnread}
                    className="p-1.5 hover:bg-slate-100 dark:hover:bg-slate-800 rounded-lg transition-colors"
                    title="Mark as unread"
                  >
                    <Mail className="w-4 h-4 text-slate-600 dark:text-slate-400" />
                  </button>
                ) : (
                  <button
                    onClick={onMarkAsRead}
                    className="p-1.5 hover:bg-slate-100 dark:hover:bg-slate-800 rounded-lg transition-colors"
                    title="Mark as read"
                  >
                    <MailOpen className="w-4 h-4 text-slate-600 dark:text-slate-400" />
                  </button>
                )}
                <button
                  onClick={onDismiss}
                  className="p-1.5 hover:bg-rose-100 dark:hover:bg-rose-900/30 hover:text-rose-600 dark:hover:text-rose-400 rounded-lg transition-colors"
                  title="Dismiss"
                >
                  <X className="w-4 h-4 text-slate-600 dark:text-slate-400" />
                </button>
              </div>
            </div>

            {/* Description */}
            <p className="text-sm text-slate-600 dark:text-slate-400 mb-3">
              {notification.description}
            </p>

            {/* Metadata */}
            <div className="flex items-center gap-4 text-xs text-slate-500 dark:text-slate-400">
              <span>
                {formatDistanceToNow(new Date(notification.timestamp), { addSuffix: true })}
              </span>
              {notification.certificationName && (
                <>
                  <span>•</span>
                  <span className="font-medium">{notification.certificationName}</span>
                </>
              )}
              {notification.teamName && (
                <>
                  <span>•</span>
                  <span className="font-medium">{notification.teamName}</span>
                </>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}

import { createServerFn } from '@tanstack/react-start';
import { eq } from 'drizzle-orm';
import { userCertifications } from '../db/schema';
import type { UserCertification } from '../types';

export const getUserCertifications = createServerFn({ method: 'GET' })
    .handler(async () => {
        const { getDb, instanceId } = await import('../db/db.server');
        const db = await getDb();
        if (!db) throw new Error(`Database not available (Server Instance: ${instanceId})`);

        try {
            const result = await db.select().from(userCertifications);
            const mapped = result.map((cert) => ({
                ...cert,
                verifiedAt: cert.verifiedAt?.toISOString() || '',
                status: (cert.status || 'active') as UserCertification['status'],
            })) as Array<UserCertification>;
            console.log(`✅ [Server] Returning ${mapped.length} user certifications`);
            return mapped;
        } catch (error) {
            console.error('❌ [Server] Failed to fetch user certifications:', error);
            return [];
        }
    });

interface CreateCertificationInput {
    userId?: string;
    certificationId?: string;
    certificationName?: string;
    vendorName?: string;
    certificationNumber?: string;
    issueDate?: string;
    expirationDate?: string;
    status?: string;
    daysUntilExpiration?: number;
    documentUrl?: string;
    verifiedAt?: string | Date;
}

export const createCertification = createServerFn({ method: 'POST' })
    .inputValidator((data: unknown): CreateCertificationInput => {
        if (typeof data === 'object' && data !== null) {
            return data as CreateCertificationInput;
        }
        throw new Error('Invalid input data');
    })
    .handler(async ({ data }) => {
        const { getDb } = await import('../db/db.server');
        const db = await getDb();
        if (!db) throw new Error('Database not available');

        try {
            const verifiedAtValue = data.verifiedAt
                ? (typeof data.verifiedAt === 'string' ? new Date(data.verifiedAt) : data.verifiedAt)
                : new Date();

            const result = await db.insert(userCertifications).values({
                userId: data.userId || 'user-001',
                certificationId: data.certificationId || 'manual',
                certificationName: data.certificationName || 'Unknown Certification',
                vendorName: data.vendorName || 'Unknown Vendor',
                certificationNumber: data.certificationNumber,
                issueDate: data.issueDate,
                expirationDate: data.expirationDate,
                status: data.status || 'active',
                daysUntilExpiration: data.daysUntilExpiration,
                documentUrl: data.documentUrl || '',
                verifiedAt: verifiedAtValue,
            }).returning();

            if (!result || result.length === 0) throw new Error('Failed to create certification record');
            const newCert = result[0];
            return {
                ...newCert,
                verifiedAt: newCert.verifiedAt?.toISOString() || '',
                status: newCert.status as UserCertification['status'],
            } as UserCertification;
        } catch (error) {
            console.error('❌ [Server] Failed to create certification:', error);
            throw error;
        }
    });

interface UpdateCertificationInput {
    id: string;
    updates: {
        userId?: string;
        certificationId?: string;
        certificationName?: string;
        vendorName?: string;
        certificationNumber?: string;
        issueDate?: string;
        expirationDate?: string;
        status?: string;
        daysUntilExpiration?: number;
        documentUrl?: string;
        verifiedAt?: string | Date;
    };
}

export const updateCertification = createServerFn({ method: 'POST' })
    .inputValidator((data: unknown): UpdateCertificationInput => {
        if (typeof data === 'object' && data !== null && 'id' in data && 'updates' in data) {
            return data as UpdateCertificationInput;
        }
        throw new Error('Invalid input data');
    })
    .handler(async ({ data }) => {
        const { getDb } = await import('../db/db.server');
        const db = await getDb();
        if (!db) throw new Error('Database not available');

        try {
            const { id, updates } = data;
            const { verifiedAt, ...rest } = updates;
            const updateData: Record<string, unknown> = { ...rest };
            if (verifiedAt) {
                updateData.verifiedAt = typeof verifiedAt === 'string' ? new Date(verifiedAt) : verifiedAt;
            }
            if ('updatedAt' in updateData) {
                delete updateData.updatedAt;
            }
            const result = await db.update(userCertifications)
                .set({ ...updateData, updatedAt: new Date() })
                .where(eq(userCertifications.id, id))
                .returning();
            if (!result || result.length === 0) return null;
            const updatedCert = result[0];
            return {
                ...updatedCert,
                verifiedAt: updatedCert.verifiedAt?.toISOString() || '',
                status: updatedCert.status as UserCertification['status'],
            } as UserCertification;
        } catch (error) {
            console.error('❌ [Server] Failed to update certification:', error);
            throw error;
        }
    });

export const deleteCertification = createServerFn({ method: 'POST' })
    .inputValidator((data: string) => data)
    .handler(async ({ data: id }) => {
        const { getDb } = await import('../db/db.server');
        const db = await getDb();
        if (!db) throw new Error('Database not available');

        try {
            await db.delete(userCertifications).where(eq(userCertifications.id, id));
            return { success: true };
        } catch (error) {
            console.error('❌ [Server] Failed to delete certification:', error);
            throw error;
        }
    });

