import { HeadContent, Link, Outlet, Scripts, createRootRouteWithContext, useRouter } from '@tanstack/react-router'
import { QueryClient, QueryClientProvider  } from '@tanstack/react-query'
import { ClerkProvider, RedirectToSignIn, useAuth, useUser } from '@clerk/tanstack-react-start'
import { useEffect } from 'react'
import { AppShell } from '../components/shell/AppShell'
import { ENV } from '../lib/env'

import appCss from '../styles.css?url'

export const Route = createRootRouteWithContext<{
  queryClient: QueryClient
}>()({
  head: () => ({
    meta: [
      {
        charSet: 'utf-8',
      },
      {
        name: 'viewport',
        content: 'width=device-width, initial-scale=1',
      },
      {
        title: 'Training-Certify Platform',
      },
      {
        name: 'description',
        content: 'Enterprise certification tracking and compliance management platform.',
      },
    ],
    links: [
      {
        rel: 'stylesheet',
        href: appCss,
      },
      {
        rel: 'icon',
        href: '/favicon.ico',
      },
    ],
  }),

  shellComponent: RootDocument,
  component: RootComponent,
  notFoundComponent: () => (
    <div className="p-8 text-center">
      <h2 className="text-2xl font-bold">404 - Page Not Found</h2>
      <p className="text-slate-600 mt-2">The section you are looking for does not exist.</p>
      <Link to="/" className="text-blue-600 hover:underline mt-4 inline-block">Go to Dashboard</Link>
    </div>
  ),
