      <button onClick={() => window.location.reload()} className="mt-4 px-4 py-2 bg-red-600 text-white rounded hover:bg-red-700">
        Reload Page
      </button>
    </div>
  ),
})

function RootDocument({ children }: { children: React.ReactNode }) {
  const router = useRouter()
  const queryClient = router.options.context?.queryClient ?? new QueryClient()

  return (
    <html lang="en">
      <head>
        <HeadContent />
        <script
          dangerouslySetInnerHTML={{
            __html: `window.__ENV__ = { CLERK_PUBLISHABLE_KEY: ${JSON.stringify(ENV.CLERK_PUBLISHABLE_KEY)} };`,
          }}
        />
      </head>
      <body>
        <ClerkProvider publishableKey={ENV.CLERK_PUBLISHABLE_KEY}>
          <QueryClientProvider client={queryClient}>
            {children}
          </QueryClientProvider>
        </ClerkProvider>
        <Scripts />
      </body>
    </html>
  )
}

function RootComponent() {
  const { isLoaded, isSignedIn } = useAuth()
  const { user } = useUser()
  const router = useRouter()
  const path = router.state.location.pathname

  const isAuthPage = path.startsWith('/sign-in') || path.startsWith('/sign-up')

  useEffect(() => {
    if (isSignedIn && user) {
      // Use fetch API instead of broken createServerFn
      fetch('/api/users', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          id: user.id,
          name: `${user.firstName} ${user.lastName}`.trim() || user.username || 'User',
          email: user.emailAddresses[0]?.emailAddress || '',
          avatarUrl: user.imageUrl
        })
      })
        .then((res) => res.json())
        .then((data) => {
          console.log('👤 [Client] User synced with DB:', data.role)
        })
        .catch((err) => {
          console.error('❌ [Client] Sync failed:', err)
        })
    }
  }, [isSignedIn, user])



  if (!isLoaded) {
    return <div className="flex items-center justify-center min-h-screen">Loading...</div>
  }

  if (!isSignedIn && !isAuthPage) {
    return <RedirectToSignIn />
  }

  return (
    <AppShell>
      <Outlet />
    </AppShell>
  )
}

import { createFileRoute } from '@tanstack/react-router'
import { json } from '@tanstack/react-start'
import { getDb } from '../db/db.server'
import { auditLogs } from '../db/schema'

export const Route = createFileRoute('/api/compliance')({
    server: {
        handlers: {
            GET: async () => {
                try {
                    const db = await getDb()
                    if (!db) {
                        return json({ error: 'Database not available' }, { status: 500 })
                    }

                    const logs = await db.select().from(auditLogs).limit(50)
                    const totalAudits = logs.length
                    const issuesFound = logs.filter((l) => l.action?.includes('issue') || l.action?.includes('failed')).length

                    return json({
                        auditLogs: logs.map(l => ({
                            id: l.id,
                            user: l.userId || 'System',
                            action: l.action,
                            date: l.timestamp,
                            status: 'verified'
                        })),
                        stats: {
                            complianceRate: 98,
                            totalAudits,
                            issuesFound
                        }
                    })
                } catch (error) {
                    console.error('[API Compliance] Error:', error)
                    return json({
                        auditLogs: [],
                        stats: { complianceRate: 0, totalAudits: 0, issuesFound: 0 }
                    })
                }
            }
        }
    }
})

import { createFileRoute } from '@tanstack/react-router'
import { json } from '@tanstack/react-start'
import { and, eq } from 'drizzle-orm'
import { getDb } from '../db/db.server'
import { notifications } from '../db/schema'

// Default notification categories
const defaultCategories = [
    { id: 'expiration-alert', name: 'Expiration Alerts', description: 'Alerts when certifications are about to expire' },
    { id: 'renewal-reminder', name: 'Renewal Reminders', description: 'Reminders to renew certifications' },
    { id: 'team-member-alert', name: 'Team Updates', description: 'Notifications about team member certifications' },
    { id: 'compliance-warning', name: 'Compliance Warnings', description: 'Warnings about compliance issues' },
]

export const Route = createFileRoute('/api/notification-settings')({
    server: {
        handlers: {
            // GET notification settings/categories
            GET: async ({ request }) => {
                try {
                    const url = new URL(request.url)
                    const userId = url.searchParams.get('userId')

                    // Return default categories (in production, would fetch from DB)
                    return json({
                        categories: defaultCategories,
                        userPreferences: {
                            // Default all enabled
                            'expiration-alert': true,
                            'renewal-reminder': true,
                            'team-member-alert': true,
                            'compliance-warning': true,
                            emailEnabled: true,
                            pushEnabled: false
                        }
                    })
                } catch (error) {
                    console.error('[API Notification Settings GET] Error:', error)
                    return json({ categories: defaultCategories, userPreferences: {} })
                }
            },
            // PATCH - Update user notification preferences
            PATCH: async ({ request }) => {
                try {
                    const data = await request.json()
                    const { userId, preferences } = data

                    if (!userId) {
                        return json({ error: 'userId is required' }, { status: 400 })
                    }

                    // In production, save to DB
                    console.log(`✅ [API] Updated notification preferences for ${userId}:`, preferences)
                    return json({ success: true, preferences })
                } catch (error) {
                    console.error('[API Notification Settings PATCH] Error:', error)
                    return json({ error: 'Failed to update preferences' }, { status: 500 })
                }
            },
            // POST - Mark notifications as read
            POST: async ({ request }) => {
                try {
                    const data = await request.json()
                    const { action, notificationId, userId } = data

                    const db = await getDb()
                    if (!db) {
                        return json({ error: 'Database not available' }, { status: 500 })
                    }

                    if (action === 'markRead' && notificationId) {
                        await db.update(notifications)
                            .set({ isRead: true })
                            .where(eq(notifications.id, notificationId))
                        return json({ success: true })
                    } else if (action === 'markAllRead' && userId) {
                        await db.update(notifications)
                            .set({ isRead: true })
                            .where(eq(notifications.userId, userId))
                        return json({ success: true })
                    } else if (action === 'dismiss' && notificationId) {
                        await db.update(notifications)
                            .set({ isDismissed: true })
                            .where(eq(notifications.id, notificationId))
                        return json({ success: true })
                    }

                    return json({ error: 'Invalid action' }, { status: 400 })
                } catch (error) {
                    console.error('[API Notification Settings POST] Error:', error)
                    return json({ error: 'Failed to update notification' }, { status: 500 })
                }
            }
        }
    }
})
